import { Component } from '@angular/core';
import { navLinks } from '../constants';

@Component({
  selector: 'app-nav',
  templateUrl: './nav.component.html',
  styleUrls: ['./nav.component.scss']
})

export class NavComponent {
  navLinks = navLinks;
}
<div class="styledLinks">
  <ul>
    <li *ngFor="let i of navLinks">
      <a mat-button href={{i.url}}>{{i.index}}. {{i.name}}</a>
    </li>
  </ul>
  <a mat-flat-button color="warn" class="resumeLink" href="https://docs.google.com/document/d/1T6ql4c_nCS0y0mT419CpAsC9hIuh96L3TaR7cNHHNLo/edit?usp=sharing" target="_blank">Resume Link</a>
</div>
